import "./style.css";

import PaidDebtIcon from "../../../assets/paidcharges.svg";
import ExpiredDebtIcon from "../../../assets/overduecharges.svg";
import PendingDebtIcon from "../../../assets/expectedcharges.svg";

function CardSumDebts({ status, debts }) {
  return (
    <div
      className={
        status === "paid"
          ? "paid chargeTitle-container"
          : status === "overdue"
            ? "overdue chargeTitle-container"
            : "expected  chargeTitle-container"
      }
    >
      <img
        src={
          status === "paid"
            ? Paidcharges
            : status === "overdue"
              ? Overduecharges
              : Expectedcharges
        }
        alt="StatusIcon"
        className="statusIcon"
      />
      <div className="container-name">
        <h1>
          {status === "paid"
            ? "Cobranças Pagas"
            : status === "overdue"
              ? "Cobranças Vencidas"
              : "Cobranças Previstas"}
        </h1>
        <p>
          {status === "paid"
            ? "R$ 30.000"
            : status === "overdue"
              ? "R$ 7.000"
              : "R$ 10.000"}
        </p>
      </div>
    </div>
  );
}

export default CardSumDebts;
